import React from 'react'
import useProducts from '../data/useProducts'

var productsNotNull = [];
const Shop = () => {
    const products = useProducts();
    products.map(item => (
        productsNotNull = item
    ))
    if (productsNotNull.length !== 0 ) {
        return (
            <div className='container'>
                <div className="row">
                <div className="sidebar col-sm-3 col-md-3">
                    <form action="">
                        <input type="search" name='search' placeholder='Search.....'/>
                    </form>
                </div>
                <div className=''>
                    {
                        productsNotNull.map(item => (
                        <p key={item}>{item.name}</p>
                        ))
                    }
                </div>
                </div>
            </div>
        )
    }
}

export default Shop
